import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import Swal from 'sweetalert2';
import 'bootstrap/dist/css/bootstrap.min.css';

const Register = () => {
    const [formData, setFormData] = useState({
        primerNombre: '',
        segundoNombre: '',
        primerApellido: '',
        segundoApellido: '',
        email: '',
        fechaNacimiento: '',
        identificacion: '',
        usuario: '',
        password: '',
    });
    const [error, setError] = useState('');
    const navigate = useNavigate();

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData({ ...formData, [name]: value });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            const response = await fetch('http://localhost:9001/Laboratorio1/', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json',
                },
                body: JSON.stringify(formData),
            });

            if (response.ok) {
                Swal.fire('Registro exitoso', '¡Bienvenido!', 'success');
                navigate('/login'); // Redirigir a la página de login después del registro
            } else {
                const errorMessage = await response.text();
                setError(errorMessage || 'Error al registrar. Intenta nuevamente.');
            }
        } catch (error) {
            console.error('Error en el registro:', error);
            setError('Error al registrar. Intenta nuevamente.');
        }
    };

    return (
        <div className="container-fluid" style={{ 
            background: 'linear-gradient(to right, #c1d3ff, #c9b1ff)', 
            minHeight: '100vh', 
            padding: '20px' 
        }}>
            <h1 className="mb-4">Registro de Usuario</h1>

            {error && <div className="alert alert-danger">{error}</div>}

            <form onSubmit={handleSubmit} className="bg-light p-4 rounded">
                <div className="mb-3">
                    <label htmlFor="primerNombre" className="form-label">Primer Nombre</label>
                    <input 
                        type="text" 
                        className="form-control" 
                        id="primerNombre" 
                        name="primerNombre" 
                        value={formData.primerNombre} 
                        onChange={handleChange} 
                        required 
                    />
                </div>
                <div className="mb-3">
                    <label htmlFor="segundoNombre" className="form-label">Segundo Nombre</label>
                    <input 
                        type="text" 
                        className="form-control" 
                        id="segundoNombre" 
                        name="segundoNombre" 
                        value={formData.segundoNombre} 
                        onChange={handleChange} 
                    />
                </div>
                <div className="mb-3">
                    <label htmlFor="primerApellido" className="form-label">Primer Apellido</label>
                    <input 
                        type="text" 
                        className="form-control" 
                        id="primerApellido" 
                        name="primerApellido" 
                        value={formData.primerApellido} 
                        onChange={handleChange} 
                        required 
                    />
                </div>
                <div className="mb-3">
                    <label htmlFor="segundoApellido" className="form-label">Segundo Apellido</label>
                    <input 
                        type="text" 
                        className="form-control" 
                        id="segundoApellido" 
                        name="segundoApellido" 
                        value={formData.segundoApellido} 
                        onChange={handleChange} 
                    />
                </div>
                <div className="mb-3">
                    <label htmlFor="email" className="form-label">Email</label>
                    <input 
                        type="email" 
                        className="form-control" 
                        id="email" 
                        name="email" 
                        value={formData.email} 
                        onChange={handleChange} 
                        required 
                    />
                </div>
                <div className="mb-3">
                    <label htmlFor="fechaNacimiento" className="form-label">Fecha de Nacimiento</label>
                    <input 
                        type="date" 
                        className="form-control" 
                        id="fechaNacimiento" 
                        name="fechaNacimiento" 
                        value={formData.fechaNacimiento} 
                        onChange={handleChange} 
                        required 
                    />
                </div>
                <div className="mb-3">
                    <label htmlFor="identificacion" className="form-label">Identificación</label>
                    <input 
                        type="text" 
                        className="form-control" 
                        id="identificacion" 
                        name="identificacion" 
                        value={formData.identificacion} 
                        onChange={handleChange} 
                        required 
                    />
                </div>
                <div className="mb-3">
                    <label htmlFor="usuario" className="form-label">Usuario</label>
                    <input 
                        type="text" 
                        className="form-control" 
                        id="usuario" 
                        name="usuario" 
                        value={formData.usuario} 
                        onChange={handleChange} 
                        required 
                    />
                </div>
                <div className="mb-3">
                    <label htmlFor="password" className="form-label">Contraseña</label>
                    <input 
                        type="password" 
                        className="form-control" 
                        id="password" 
                        name="password" 
                        value={formData.password} 
                        onChange={handleChange} 
                        required 
                    />
                </div>
                <button type="submit" className="btn btn-primary">Registrar</button>
            </form>
        </div>
    );
};

export default Register;
